const http = require('http')

const data = JSON.stringify({
nome: "teste",
nome_foto: "teste",
local_foto: "teste",
data_foto: new Date().toDateString(),
img_base64: "",
termos: true
})

const options = {
  hostname: 'apidev.inema.ba.gov.br',
  path: '/participante',
  method: 'POST',
  headers: {
    'Content-Type': 'application/json',
    'Content-Length': data.length
  }
}

const req = http.request(options, res => {
  console.log(`statusCode: ${res.statusCode}`)

  res.on('data', d => {
    process.stdout.write(d)
  })
})

req.on('error', error => {
  console.error(error)
})

req.write(data)
req.end()